var Animation, Model, animation;

animation = {
  anims: [],
  models: []
};

Animation = class Animation {
  constructor(animSet1) {
    this.animSet = animSet1;
  }

  static load() {
    var anim, img, name, ref;
    ref = animation.anims;
    for (name in ref) {
      anim = ref[name];
      img = document.createElement('img');
      img.src = 'images/' + name + '.png';
      anim.img = img;
    }
    return null;
  }

  setAnimation(num) {
    var anim;
    anim = this.animSet.sets[num];
    if (anim !== this.current) {
      this.current = anim;
      this.time = anim.frameTime;
      return this.nFrame = 0;
    }
  }

  reset() {
    this.time = this.current.frameTime;
    return this.nFrame = 0;
  }

  incAnim(cycle = true) {
    this.time--;
    if (this.time <= 0) {
      this.time = this.current.frameTime;
      this.nFrame++;
      if (this.nFrame >= this.current.frames.length) {
        this.nFrame = cycle ? 0 : this.current.frames.length - 1;
        return !cycle;
      }
    }
    return false;
  }

  play(g, x, y, flipX = false, flipY = false) {
    var frame;
    frame = this.current.frames[this.nFrame];
    if (frame != null) {
      x = flipX ? -x + frame.centerX - frame.width : x - frame.centerX;
      y = flipY ? -y - frame.centerY : y + frame.centerY - frame.height;
      g.save();
      g.scale((flipX ? -1 : 1), (flipY ? -1 : 1));
      g.drawImage(this.animSet.img, frame.x1, frame.y1, frame.x2, frame.y2, x, y, frame.width, frame.height);
      g.restore();
    }
    return this;
  }

};

Model = (function() {
  class Model {
    constructor(animSet) {
      var key, ref, ref1, set;
      this.animSet = animSet;
      if (animSet.anims != null) {
        this.sets = [];
        ref = animSet.anims;
        for (key in ref) {
          set = ref[key];
          (this.sets[key] = new Animation(animation.anims[set.name])).setAnimation((ref1 = set.anim) != null ? ref1 : 0);
        }
      }
    }

    incAnim(cycle = true) {
      var anim, j, len, ref, ret;
      ret = false;
      if (this.sets != null) {
        ref = this.sets;
        for (j = 0, len = ref.length; j < len; j++) {
          anim = ref[j];
          ret |= anim.incAnim(cycle);
        }
      }
      return ret;
    }

    play(g, x, y, zoom = 1) {
      var i, indx, j, k, layer, len, len1, n, poly, ref, ref1, vert, verts, xL, yL, z;
      layer = Game.getGame().engine.layer;
      xL = layer.x;
      yL = layer.y;
      x -= xL;
      y -= yL;
      z = .0;
      verts = this.animSet.verts;
      i = 0;
      for (j = 0, len = verts.length; j < len; j++) {
        vert = verts[j];
        z = vert.z * zoom;
        Model.x[i] = (vert.x + x) * z + xL;
        Model.y[i] = (vert.y + y) * z + yL;
        i++;
      }
      ref = this.animSet.faces;
      for (k = 0, len1 = ref.length; k < len1; k++) {
        poly = ref[k];
        if (poly.anim != null) {
          this.sets[poly.anim].play(g, Model.x[poly.vert], Model.y[poly.vert]);
        } else {
          g.fillStyle = (ref1 = poly.col) != null ? ref1 : '#000000';
          n = poly.verts.length;
          if (n > 2) {
            i = n - 1;
            g.beginPath();
            indx = poly.verts[i];
            g.moveTo(Model.x[indx], Model.y[indx]);
            i--;
            while (i >= 0) {
              indx = poly.verts[i];
              g.lineTo(Model.x[indx], Model.y[indx]);
              i--;
            }
            g.closePath();
            g.fill();
          } else {
            g.beginPath();
            indx = poly.verts[0];
            g.moveTo(Model.x[indx], Model.y[indx]);
            indx = poly.verts[1];
            g.lineTo(Model.x[indx], Model.y[indx]);
            g.closePath();
            g.stroke();
          }
        }
      }
      return null;
    }

  };

  Model.x = [];

  Model.y = [];

  return Model;

}).call(this);
var Engine;

Engine = (function() {
  class Engine {
    loadLevel(level = Engine.START_LEVEL) {
      /*level = Engine.levels[level]
      if @level != level
      	@level = level
       * Init layers
      	for key, layer of level.layers
      		layer = level.layers[key] = Object.create Layer, layer
      		do layer.load
      level */
      this.anim = new Model(animation.models['models/house0back']);
      return this.anim2 = new Model(animation.models['models/house0front']);
    }

    act(game) {
      this.anim.incAnim();
      return this.anim.incAnim();
    }

    draw(g) {
      g.save();
      g.translate(512, 320);
      this.anim.play(g, -480, 280);
      this.anim2.play(g, -480, 280);
      return g.restore();
    }

  };

  Engine.START_LEVEL = 'start';

  Engine.objectsClasses = [];

  Engine.objects = [];

  Engine.levels = [];

  Engine.prototype.layer = {
    x: 0,
    y: 0
  };

  return Engine;

}).call(this);
var Game;

Game = (function() {
  var instance;

  class Game {
    constructor() {
      this.canvas = $$('#game-canvas');
      this.canvas.width = Game.width;
      this.canvas.height = Game.height;
      this.canvas.lineWidth = 2;
      this.context = this.canvas.getContext('2d');
    }

    load(load_callback) {
      // Settings load
      this.settings = settings.load();
      // Animation load
      Animation.load();
      this.engine = new Engine();
      load_callback();
      return this;
    }

    run(proc) {
      if (this.interval != null) {
        clearInterval(this.interval);
      }
      return this.interval = setInterval((function() {
        var game;
        game = Game.getGame();
        proc.act(game);
        return proc.draw(game.context);
      }), this.TIME_FRAME);
    }

    static getGame() {
      return instance != null ? instance : instance = new Game();
    }

  };

  instance = null;

  Game.width = 1024;

  Game.height = 640;

  Game.TIME_FRAME = 33;

  return Game;

}).call(this);
var Layer;

Layer = (function() {
  class Layer {
    laod() {
      var engine, i, len, object, ref, results;
      engine = Game.getGame().engine;
      ref = this.object;
      results = [];
      for (i = 0, len = ref.length; i < len; i++) {
        object = ref[i];
        object.data = engine.objects[object.name];
        if (this.autoParalax) {
          object.x *= this.paralaxX;
          results.push(object.y *= this.paralaxY);
        } else {
          results.push(void 0);
        }
      }
      return results;
    }

    init() {
      var objs;
      this.xOffs = this.yOffs = 0;
      this.curObj = this.objects.lenght - 1;
      return objs = [];
    }

    act() {
      var engine;
      if ((this.curObj != null) || objs.lenght !== 0) {
        engine = Game.getGame().engine;
        this.x = (engine.camX + this.xOffs) * this.paralaxX - Game.width / 2;
        return this.x = (engine.camY + this.yOffs) * this.paralaxY - Game.height / 2;
      }
    }

    draw(g) {
      var i, len, object, ref;
      g.save();
      g.translate(-this.x, -this.y);
      ref = this.objs;
      for (i = 0, len = ref.length; i < len; i++) {
        object = ref[i];
        object.draw(g);
      }
      
      return g.restore();
    }

  };

  Layer.prototype.paralaxX = 1;

  Layer.prototype.paralaxY = 1;

  Layer.prototype.autoParalax = true;

  return Layer;

}).call(this);
'use strikt';
var $$, anim, anim2;

$$ = function(selector, node = document) {
  return node.querySelector(selector);
};

anim = null;

anim2 = null;

window.addEventListener('load', function() {
  var game;
  game = Game.getGame();
  return game.load(function() {
    return setTimeout((function() {
      var engine;
      $$('.preloader').classList.add('done');
      engine = game.engine;
      engine.loadLevel();
      return setTimeout((function() {
        return game.run(engine);
      }), 0);
    }), 1000);
  });
});
var settings;

settings = {
  KEY: 'settings',
  load: function() {
    var params;
    params = localStorage.getItem(settings.KEY);
    if (params != null) {
      params = JSON.parse(params);
    } else {
      params = {};
      settings.reset(params);
    }
    return params;
  },
  save: function(params) {
    return localStorage.setItem(settings.KEY, JSON.stringify(params));
  },
  reset: function(params) {
    params.fullscreen = false;
    params.keys = [];
    params.keys[0] = {
      up: 0,
      down: 0,
      left: 0,
      right: 0,
      fire: 0,
      jump: 0,
      take: 0
    };
    return params.keys[1] = {
      up: 0,
      down: 0,
      left: 0,
      right: 0,
      fire: 0,
      jump: 0,
      take: 0
    };
  }
};
